import Link from 'next/link'

function Navbar(props) {
  return (
    <>
      <style jsx>{`
        div {
            margin: auto;
            width: 50%;
            border: 3px solid green;
            padding: 10px;
            text-align: center;
          }

          .light {
            background-color: #999;
          }
      `}</style>
      <h1>My App</h1>
      <Link href="/About">Home</Link>
      {/* <li>About</li>
        <li>API</li> */}
      {this.props.children}
    </>);
}

export default Navbar;
